import { NavLink, Link, useNavigate } from 'react-router-dom';
export default function Home() {
    const nav = useNavigate();
    function changeUrl(url) {
        nav('/about')
    }
    return (
        <div>
            <h2>
                <code>React Router 6</code>
            </h2>
            <h2>Home</h2>
            <button onClick={() => changeUrl() }>Go to About</button>
        </div>
    )
}
